import React, { useEffect } from "react";
import styled from "styled-components";
import BlogCard from "../Components/Cards/BlogCard/BlogCard";
import MainLayout from "../Containers/Layouts/MainLayout/MainLayout";
import Prismic from "prismic-javascript";
export default function Blog() {
  useEffect(() => {
    const fetchPrismicData = async () => {
      try {
        const homeDoc = await Client.query(
          Prismic.Predicates.at("document.type", "feature_post"),
          { orderings: "[my.post.date desc]" }
        );
      } catch (error) {
        console.warn(
          "Blog Home document was not found. Make sure it exists in your Prismic repository"
        );
      }
    };
    fetchPrismicData();
  });
  return (
    <>
      <MainLayout>
        <BlogContainer>
          <BlogWrapper>
            <div>
              <BlogCard />
              <BlogCard />
              <BlogCard />
              <BlogCard />
              <BlogCard />
            </div>
          </BlogWrapper>
        </BlogContainer>
      </MainLayout>
    </>
  );
}

const BlogContainer = styled.div`
  /* background-color: navy; */
`;
const BlogWrapper = styled.div`
  background-color: white;
  max-width: 1172px;
  width: 100%;
  margin: 0 auto;
  padding: 60px 0;
  div {
    display: flex;
    flex-wrap: wrap;
  }
`;
